2.- Le présent Chapitre ne comprend pas :
a) les préparations lubrifiantes des n°s 27.10 ou 34.03;
b) les cires des n°s 27.12 ou 34.04;
c) les composés organiques isolés de constitution chimique définie (Chapitre 29);
d) l’héparine et ses sels (n° 30.01);
e) les solutions (autres que les collodions), dans des solvants organiques volatils, de
produits visés dans les libellés des n°s 39.01 à 39.13 lorsque la proportion du solvant
excède 50% du poids de la solution (n° 32.08); les feuilles pour le marquage au fer du
n° 32.12;
f) les agents de surface organiques et les préparations du n° 34.02;
g) les gommes fondues et les gommes esters (n° 38.06);
h) les additifs préparés pour huiles minérales (y compris l’essence) et pour autres liquides
utilisés aux mêmes fins que les huiles minérales (n° 38.11) ;
ij) les liquides hydrauliques préparés à base de polyglycols, de silicones et autres polymères
du Chapitre 39 (n°38.19);

k) les réactifs de diagnostic ou de laboratoire sur un support en matière plastique (n° 38.22);
l) le caoutchouc synthétique, tel qu’il est défini au Chapitre 40, et les ouvrages en
caoutchouc synthétique ;
m) les articles de sellerie ou de bourrellerie (n° 42.01), les malles, valises, mallettes, sacs à
main et autres contenants du n° 42.02;
n) les ouvrages de sparterie ou de vannerie, du Chapitre 46;
o) les revêtements muraux du n° 48.14;
p) les produits de la Section XI (matières textiles et ouvrages en ces matières);
q) les articles de la Section XII (chaussures et parties de chaussures, coiffures et parties de
coiffures, parapluies, parasols, cannes, fouets, cravaches et leurs parties, par exemple);
r)les articles de bijouterie de fantaisie du n° 71.17;
s) les articles de la Section XVI (machines et appareils, matériel électrique);
t) les parties du matériel de transport de la Section XVII;
u) les articles du Chapitre 90 (éléments d’optique, montures de lunettes, instruments de
dessin, par exemple);
